    private bool Sentence2Features(System.IO.StreamWriter crf_file, SentenceData sent)
    {
        // ----------------------------------------------
        // Готовим наборы признаков для каждого токена
        // ----------------------------------------------

        List<CRFTokenFeatures> token_features = new List<CRFTokenFeatures>();

        CRFTokenFeatures start = GetFeatures(0, sent.CountWords(), sent.GetWord(0), sent.GetWord(0).all_projs);
        start.suffix = "<START>";
        start.suffix_id = START_id;
        start.crf_word = start.org_word = start.word = "<START>";
        //  start.output_tags.Add( tags.MatchTags( sample.morphology[0], gren ) );
        token_features.Add(start);

        for (int iword = 1; iword < sent.CountWords() - 1; ++iword)
        {
            CRFTokenFeatures f = GetFeatures(iword, sent.CountWords(), sent.GetWord(iword), sent.GetWord(iword).all_projs);
            token_features.Add(f);
        }

        CRFTokenFeatures end = GetFeatures(sent.CountWords() - 1, sent.CountWords(), sent.GetWord(sent.CountWords() - 1), sent.GetWord(sent.CountWords() - 1).all_projs);
        end.suffix = "<END>";
        end.suffix_id = END_id;
        end.crf_word = end.org_word = end.word = "<END>";
        //  end.output_tags.Add( tags.MatchTags( sample.morphology[sample.morphology.Count - 1], gren ) );
        token_features.Add(end);

        int N = sent.CountWords();
        int last_word_index = N - 1;

        System.Text.StringBuilder b = new System.Text.StringBuilder();

        for (int iword = 0; iword < N; ++iword)
        {
            b.Length = 0;

            CRFTokenFeatures f_this = token_features[iword];

            // -----------------------------
            // признаки для текущего слова
            // -----------------------------
            PullFeatures1(b, token_features, iword, 0, true, EMIT_AA_FEATURE);

            bool rich_context = EMIT_POS_FOR_CONTEXT || EMIT_MORPH_FOR_CONTEXT || EMIT_FORMTAGS_FOR_CONTEXT;

            // и соседние слова
            if (CONTEXT_SIZE > 4)
                PullFeatures1(b, token_features, iword, -5, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 3)
                PullFeatures1(b, token_features, iword, -4, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 2)
                PullFeatures1(b, token_features, iword, -3, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 1)
                PullFeatures1(b, token_features, iword, -2, rich_context, EMIT_AA_FOR_CONTEXT);

            PullFeatures1(b, token_features, iword, -1, rich_context, EMIT_AA_FOR_CONTEXT);
            PullFeatures1(b, token_features, iword, 1, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 1)
                PullFeatures1(b, token_features, iword, 2, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 2)
                PullFeatures1(b, token_features, iword, 3, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 3)
                PullFeatures1(b, token_features, iword, 4, rich_context, EMIT_AA_FOR_CONTEXT);

            if (CONTEXT_SIZE > 4)
                PullFeatures1(b, token_features, iword, 5, rich_context, EMIT_AA_FOR_CONTEXT);

            // --------------------------------------------------------

            if (EMIT_PAIRWISE_FEATURE)
            {
                if (CONTEXT_SIZE > 2)
                    PullFeatures2(b, token_features, iword, -3, -2);

                if (CONTEXT_SIZE > 1)
                    PullFeatures2(b, token_features, iword, -2, -1);

                PullFeatures2(b, token_features, iword, -1, 0);
                PullFeatures2(b, token_features, iword, 0, 1);

                if (CONTEXT_SIZE > 1)
                    PullFeatures2(b, token_features, iword, 1, 2);

                if (CONTEXT_SIZE > 2)
                    PullFeatures2(b, token_features, iword, 3, 4);
            }

            // --------------------------------------------------------

            /*
                 PullFeatures3( b, token_features, iword, -3, -2, -1 );
                 PullFeatures3( b, token_features, iword, -2, -1, 0 );
                 PullFeatures3( b, token_features, iword, -1, 0, 1 );
                 PullFeatures3( b, token_features, iword, 0, 1, 2 );
                 PullFeatures3( b, token_features, iword, 1, 2, 3 );
            */

            crf_file.Write("{0}", f_this.output_tag);

            if (EMIT_FORM_TAGS)
            {
                for (int k = 0; k < f_this.allform_tags.Count; ++k)
                {
                    crf_file.Write("{0}{1}", FieldDelimiter(), f_this.allform_tags[k]);
                }
            }

            crf_file.WriteLine("{0}", b.ToString());
            n_train_patterns++;
        }


        crf_file.WriteLine(""); // пустые строки отделяют предложения
        crf_file.Flush();

        return true;
    }


    bool IsUnknownLexem(string s)
    {
        return s.Equals("UNKNOWNENTRY", System.StringComparison.InvariantCultureIgnoreCase) ||
               s == "???" ||
               s.Equals("number_", System.StringComparison.InvariantCultureIgnoreCase);
    }

    int MatchSuffix(string suffix)
    {
        int id = -1;

        if (suffices.TryGetValue(suffix, out id))
            return id;

        id = suffix_seq++;
        suffices.Add(suffix, id);
        id2suffix.Add(id, suffix);

        return id;
    }

    int MatchCharShingle(string shingle)
    {
        int id = -1;

        if (charshingles.TryGetValue(shingle, out id))
            return id;

        id = charshingle_seq++;
        charshingles.Add(shingle, id);
        id2charshingle.Add(id, shingle);

        return id;
    }

    public void SetModelParams(List<string> model_params)
    {
        foreach (string p in model_params)
        {
            string[] tx = p.Split('=');
            string pname = tx[0].Trim();
            string pval = tx[1].Trim();

            switch (pname.ToUpper())
            {
                case "LANGUAGE": LANGUAGE = pval; break;

                case "RICH_INPUT_TAGSET": RICH_INPUT_TAGSET = bool.Parse(pval); break;

                case "EMIT_FORM_TAGS": EMIT_FORM_TAGS = bool.Parse(pval); break;
                case "EMIT_FORMTAGS_FOR_CONTEXT": EMIT_FORMTAGS_FOR_CONTEXT = bool.Parse(pval); break;

                case "EMIT_MORPH_TAGS": EMIT_MORPH_TAGS = bool.Parse(pval); break;
                case "EMIT_MORPH_FOR_CONTEXT": EMIT_MORPH_FOR_CONTEXT = bool.Parse(pval); break;

                case "EMIT_POS_TAGS": EMIT_POS_TAGS = bool.Parse(pval); break;
                case "EMIT_POS_FOR_CONTEXT": EMIT_POS_FOR_CONTEXT = bool.Parse(pval); break;

                case "EMIT_AA_FEATURE": EMIT_AA_FEATURE = bool.Parse(pval); break;
                case "EMIT_AA_FOR_CONTEXT": EMIT_AA_FOR_CONTEXT = bool.Parse(pval); break;

                case "EMIT_NORMAL_FORMS": EMIT_NORMAL_FORMS = bool.Parse(pval); break;
                case "EMIT_SEMANTIC_TAGS": EMIT_SEMANTIC_TAGS = bool.Parse(pval); break;
                case "EMIT_PAIRWISE_FEATURE": EMIT_PAIRWISE_FEATURE = bool.Parse(pval); break;

                case "LEMMA_SEMATAGS": LEMMA_SEMATAGS = bool.Parse(pval); break;

                case "EMIT_CHARSHINGLES":
                    EMIT_CHARSHINGLES = int.Parse(pval);
                    break;

                case "EMIT_TOKENS": EMIT_TOKENS = bool.Parse(pval); break;

                default: throw new ApplicationException(string.Format("Unknown model param {0}={1}", pname, pval));
            }
        }

        return;
    }


