    private string GetSuffix(string word)
    {
        if (undividable_words.Contains(word))
            return word;

        int dummy;
        if (int.TryParse(word, out dummy))
        {
            if (word.Length > 1)
            {
                // Для чисел оставляем ПОСЛЕДНЮЮ ЦИФРУ
                return word.Substring(word.Length - 1);
            }
            else
                return word;
        }
        else if (word.Length > MAX_SUFFIX_LEN)
            return "~" + word.Substring(word.Length - MAX_SUFFIX_LEN);
        else
            return word;
    }

    private List<string> GetCharShingles(string org_word, int shingle_len)
    {
        List<string> shingles = new List<string>();
        if (!string.IsNullOrEmpty(org_word))
        {
            string w = "[" + org_word + "]"; // добавим символы границ
            for (int i = 0; i < w.Length - shingle_len + 1; ++i)
            {
                string shingle = w.Substring(i, shingle_len);
                shingles.Add(shingle);
            }
        }

        return shingles;
    }



