    string POS_Prob(int n_pos, int n_tot)
    {
        if (n_pos == 0)
            return "0";
        else if (n_pos == n_tot)
            return "2";
        else
            return "1";
    }

    // Загружаем внешний справочник тегов для слов (словоформы и леммы отдельно)
    Dictionary<string, List<string>> wordform2semantic = new Dictionary<string, List<string>>();
    Dictionary<string, List<string>> lemma2semantic = new Dictionary<string, List<string>>();

    public void LoadSemanticTags(string filepath)
    {
        LoadSemanticTags(filepath, LEMMA_SEMATAGS);
    }

    public void LoadSemanticTags(string filepath, bool lemmas)
    {
        if (EMIT_SEMANTIC_TAGS)
        {
            Console.WriteLine("Loading semantic tags from {0}", filepath);
            using (System.IO.StreamReader rdr = new System.IO.StreamReader(filepath))
            {
                int line_count = 0;
                while (!rdr.EndOfStream)
                {
                    string line0 = rdr.ReadLine();
                    if (line0 == null)
                        break;

                    string line = line0.Trim();
                    if (line.Length == 0)
                        continue;

                    line_count++;

                    string[] toks = line.Split('\t');
                    if (toks.Length < 2)
                    {
                        Console.WriteLine("Skipping malformed word tag in file {0} line {1}", filepath, line_count);
                    }
                    else
                    {
                        string word = toks[0].ToUpper();

                        List<string> tags;

                        if (lemmas)
                        {
                            if (!lemma2semantic.TryGetValue(word, out tags))
                            {
                                tags = new List<string>();
                                lemma2semantic.Add(word, tags);
                            }
                        }
                        else
                        {
                            if (!wordform2semantic.TryGetValue(word, out tags))
                            {
                                tags = new List<string>();
                                wordform2semantic.Add(word, tags);
                            }
                        }

                        tags.Add(toks[1]);
                    }
                }
            }

            Console.WriteLine("There are {0} tagged wordforms and {1} lemmas", wordform2semantic.Count, lemma2semantic.Count);
        }

        return;
    }



    string EncodeWordCRF(string word)
    {
        return word.Replace(" ", "_");
    }

    string GetNormalForm(int entry_id, string word)
    {
        string res = null;

        int pos = gren.GetEntryClass(entry_id);
        if (pos == SolarixGrammarEngineNET.GrammarEngineAPI.VERB_ru)
        {
            res = EncodeWordCRF(gren.GetEntryName(entry_id));
        }
        else if (pos == SolarixGrammarEngineNET.GrammarEngineAPI.INFINITIVE_ru)
        {
            res = EncodeWordCRF(gren.GetEntryName(entry_id));
        }
        else if (pos == SolarixGrammarEngineNET.GrammarEngineAPI.GERUND_2_ru)
        {
            List<int> id_verbs = gren.GetLinks(entry_id, SolarixGrammarEngineNET.GrammarEngineAPI.TO_INF_link);

            if (id_verbs.Count > 0)
            {
                res = EncodeWordCRF(gren.GetEntryName(id_verbs[0]));
            }
        }
        else if (pos == SolarixGrammarEngineNET.GrammarEngineAPI.ADJ_ru)
        {
            // это причастие?
            int id_participle = SolarixGrammarEngineNET.GrammarEngine.sol_GetEntryCoordState(gren.GetEngineHandle(), entry_id, SolarixGrammarEngineNET.GrammarEngineAPI.PARTICIPLE_ru);
            if (id_participle == 1)
            {
                List<int> id_verbs = gren.GetLinks(entry_id, SolarixGrammarEngineNET.GrammarEngineAPI.TO_INF_link);

                if (id_verbs.Count > 0)
                {
                    res = EncodeWordCRF(gren.GetEntryName(id_verbs[0]));
                }

            }
        }

        return res;
    }

    List<string> GetMorphTags(SolarixGrammarEngineNET.SyntaxTreeNode all_projs)
    {
        List<string> tags = new List<string>();

        for (int i = 0; i < all_projs.VersionCount(); ++i)
        {
            int npair = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodeVerPairsCount(all_projs.hNode, i);
            for (int j = 0; j < npair; ++j)
            {
                int id_coord = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodeVerPairCoord(all_projs.hNode, i, j);
                int id_state = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodeVerPairState(all_projs.hNode, i, j);

                string coord_name = gren.GetCoordName(id_coord);

                string state_name = null;
                if (gren.CountCoordStates(id_coord) == 0)
                    state_name = id_state.ToString();
                else
                    state_name = gren.GetCoordStateName(id_coord, id_state);

                string pair = string.Format("{0}:{1}", coord_name, state_name);
                if (!tags.Contains(pair))
                    tags.Add(pair);
            }
        }

        return tags;
    }


    List<string> GetSemanticTags(List<int> id_entries, string word)
    {
        if (EMIT_SEMANTIC_TAGS)
        {
            List<string> res = null;

            if (lemma2semantic.Count > 0)
            {
                List<string> res_list = new List<string>();

                foreach (int id_entry in id_entries)
                {
                    string norma = gren.GetEntryName(id_entry);
                    if (lemma2semantic.TryGetValue(norma.ToUpper(), out res))
                    {
                        foreach (string tag in res)
                            if (!res_list.Contains(tag))
                                res_list.Add(tag);
                    }
                }

                return res_list;
            }

            if (wordform2semantic.TryGetValue(word.ToUpper(), out res))
                return res;

        }

        return null;
    }

    CRFTokenFeatures GetFeatures(
                                 int token_index,
                                 int token_count,
                                 WordData token,
                                 SolarixGrammarEngineNET.SyntaxTreeNode all_projs
                                )
    {
        CRFTokenFeatures f = new CRFTokenFeatures();

        string original_word = token.GetWord();
        f.word = original_word.ToUpper();
        f.org_word = original_word;
        f.Aa = IsAa(original_word);

        int ekey = token.GetEntryID();
        int id_class = gren.GetEntryClass(ekey);

        if (token_index == 0)
            f.IsBegin = true;

        if (token_index == token_count - 1)
            f.IsEnd = true;

        if (EMIT_NORMAL_FORMS)
            f.crf_normal_form = GetNormalForm(ekey, f.word);

        if (EMIT_SEMANTIC_TAGS)
        {
            List<int> id_entries = new List<int>();
            for (int k = 0; k < all_projs.VersionCount(); ++k)
            {
                int id = all_projs.GetVersionEntryID(k);
                if (!id_entries.Contains(id))
                {
                    id_entries.Add(id);
                }
            }

            f.semantic_tags = GetSemanticTags(id_entries, f.word);
        }

        f.morph_tags = GetMorphTags(all_projs);

        if (MAX_SUFFIX_LEN > 0)
        {
            f.suffix = GetSuffix(f.word);
            f.suffix_id = MatchSuffix(f.suffix);
        }

        if (EMIT_CHARSHINGLES > 0)
        {
            f.charshingles = GetCharShingles(f.org_word, EMIT_CHARSHINGLES);
        }


        f.crf_word = f.word.Replace(" ", "_");

        f.output_tag = tags.MatchTags(token, gren);

        for (int i = 0; i < all_projs.VersionCount(); ++i)
        {
            int itag = -1;

            if (RICH_INPUT_TAGSET)
                itag = input_tags2.MatchTags(all_projs, i, gren);
            else
                itag = tags.MatchTags(all_projs, i, gren);

            if (!f.allform_tags.Contains(itag))
                f.allform_tags.Add(itag);
        }

        // Таблица опознания частей речи.
        List<int> ekeys = new List<int>();
        List<int> ekeys_N = new List<int>();
        List<int> ekeys_V = new List<int>();
        List<int> ekeys_IMV = new List<int>();
        List<int> ekeys_A = new List<int>();
        List<int> ekeys_I = new List<int>();
        List<int> ekeys_Y = new List<int>();
        List<int> ekeys_VY = new List<int>();
        List<int> ekeys_D = new List<int>();
        List<int> ekeys_C = new List<int>();
        List<int> ekeys_P = new List<int>();
        List<int> ekeys_PX = new List<int>();
        List<int> ekeys_PRN = new List<int>();
        List<int> ekeys_PRN2 = new List<int>();
        List<int> ekeys_PP = new List<int>();
        List<int> ekeys_MU = new List<int>();
        List<int> ekeys_PCA = new List<int>();
        List<int> ekeys_PCN = new List<int>();
        List<int> ekeys_PCV = new List<int>();
        List<int> ekeys_PCM = new List<int>();

        for (int i = 0; i < all_projs.VersionCount(); ++i)
        {
            int k = all_projs.GetVersionEntryID(i);
            if (!ekeys.Contains(k))
                ekeys.Add(k);

            int id_class1 = gren.GetEntryClass(k);

            if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.NOUN_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.NOUN_en)
            {
                if (!ekeys_N.Contains(k))
                    ekeys_N.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.VERB_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.VERB_en)
            {
                if (!ekeys_V.Contains(k))
                    ekeys_V.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.IMPERSONAL_VERB_ru)
            {
                if (!ekeys_IMV.Contains(k))
                    ekeys_IMV.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.ADJ_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.ADJ_en)
            {
                if (!ekeys_A.Contains(k))
                    ekeys_A.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.INFINITIVE_ru)
            {
                if (!ekeys_I.Contains(k))
                    ekeys_I.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.ADVERB_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.ADV_en)
            {
                if (!ekeys_Y.Contains(k))
                    ekeys_Y.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.GERUND_2_ru)
            {
                if (!ekeys_VY.Contains(k))
                    ekeys_VY.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.NUMBER_CLASS_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.NUMERAL_en)
            {
                if (!ekeys_D.Contains(k))
                    ekeys_D.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.NUM_WORD_CLASS)
            {
                if (!ekeys_C.Contains(k))
                    ekeys_C.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.PREPOS_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.PREP_en)
            {
                if (!ekeys_P.Contains(k))
                    ekeys_P.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.POSTPOS_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.POSTPOS_en)
            {
                if (!ekeys_PX.Contains(k))
                    ekeys_PX.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.PRONOUN_ru || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.PRONOUN_en)
            {
                if (!ekeys_PRN.Contains(k))
                    ekeys_PRN.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.PRONOUN2_ru)
            {
                if (!ekeys_PRN2.Contains(k))
                    ekeys_PRN2.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.POSESS_PARTICLE || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.POSSESSION_PARTICLE_en)
            {
                if (!ekeys_PP.Contains(k))
                    ekeys_PP.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.MEASURE_UNIT)
            {
                if (!ekeys_MU.Contains(k))
                    ekeys_MU.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_ADJ_PREFIX || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_PREADJ_en)
            {
                if (!ekeys_PCA.Contains(k))
                    ekeys_PCA.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_NOUN_PREFIX || id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_PRENOUN_en)
            {
                if (!ekeys_PCN.Contains(k))
                    ekeys_PCN.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_PREVERB_en)
            {
                if (!ekeys_PCV.Contains(k))
                    ekeys_PCV.Add(k);
            }
            else if (id_class1 == SolarixGrammarEngineNET.GrammarEngineAPI.COMPOUND_PREADV_en)
            {
                if (!ekeys_PCM.Contains(k))
                    ekeys_PCM.Add(k);
            }

        }

        int n_tot = ekeys.Count;

        f.POS_N = POS_Prob(ekeys_N.Count, n_tot);
        f.POS_V = POS_Prob(ekeys_V.Count, n_tot);
        f.POS_IMV = POS_Prob(ekeys_IMV.Count, n_tot);
        f.POS_A = POS_Prob(ekeys_A.Count, n_tot);
        f.POS_PRN = POS_Prob(ekeys_PRN.Count, n_tot);
        f.POS_PRN2 = POS_Prob(ekeys_PRN2.Count, n_tot);
        f.POS_I = POS_Prob(ekeys_I.Count, n_tot);
        f.POS_Y = POS_Prob(ekeys_Y.Count, n_tot);
        f.POS_VY = POS_Prob(ekeys_VY.Count, n_tot);
        f.POS_C = POS_Prob(ekeys_C.Count, n_tot);
        f.POS_D = POS_Prob(ekeys_D.Count, n_tot);
        f.POS_P = POS_Prob(ekeys_P.Count, n_tot);
        f.POS_PX = POS_Prob(ekeys_PX.Count, n_tot);
        f.POS_PP = POS_Prob(ekeys_PP.Count, n_tot);
        f.POS_MU = POS_Prob(ekeys_MU.Count, n_tot);
        f.POS_PCA = POS_Prob(ekeys_PCA.Count, n_tot);
        f.POS_PCN = POS_Prob(ekeys_PCN.Count, n_tot);
        f.POS_PCV = POS_Prob(ekeys_PCV.Count, n_tot);
        f.POS_PCM = POS_Prob(ekeys_PCM.Count, n_tot);

        return f;
    }

    string FieldDelimiter() { return "\t"; }

    void PullFeaturesSem1(System.Text.StringBuilder b, List<CRFTokenFeatures> token_features, int ifocus, int offset, string edge_part)
    {
        int iword = ifocus + offset;

        if (iword >= 0 && iword < token_features.Count)
        {
            CRFTokenFeatures f = token_features[iword];

            if (f.suffix_id != -1)
                b.AppendFormat("{2}sfx[{3},{0}]={1}", offset, f.suffix_id, FieldDelimiter(), edge_part);

            foreach (string shingle in f.charshingles)
            {
                b.AppendFormat("{0}charshingle[{1}]={2}", FieldDelimiter(), offset, MatchCharShingle(shingle));
            }


            if (EMIT_POS_TAGS)
            {
                // морфологические свойства слова
                if (LANGUAGE == "ru")
                {
                    b.AppendFormat("{2}pos[{3},{1},N]={0}", f.POS_N, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},A]={0}", f.POS_A, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},V]={0}", f.POS_V, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},IMV]={0}", f.POS_IMV, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},I]={0}", f.POS_I, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},Y]={0}", f.POS_Y, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},VY]={0}", f.POS_VY, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PRN]={0}", f.POS_PRN, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PRN2]={0}", f.POS_PRN2, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},C]={0}", f.POS_C, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},D]={0}", f.POS_D, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},P]={0}", f.POS_P, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PX]={0}", f.POS_PX, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PP]={0}", f.POS_PP, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},MU]={0}", f.POS_MU, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCA]={0}", f.POS_PCA, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCN]={0}", f.POS_PCN, offset, FieldDelimiter(), edge_part);
                }
                else if (LANGUAGE == "en")
                {
                    b.AppendFormat("{2}pos[{3},{1},N]={0}", f.POS_N, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},A]={0}", f.POS_A, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},V]={0}", f.POS_V, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},Y]={0}", f.POS_Y, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PRN]={0}", f.POS_PRN, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},C]={0}", f.POS_C, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},D]={0}", f.POS_D, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},P]={0}", f.POS_P, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PX]={0}", f.POS_PX, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PP]={0}", f.POS_PP, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCA]={0}", f.POS_PCA, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCN]={0}", f.POS_PCN, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCV]={0}", f.POS_PCV, offset, FieldDelimiter(), edge_part);
                    b.AppendFormat("{2}pos[{3},{1},PCM]={0}", f.POS_PCM, offset, FieldDelimiter(), edge_part);
                }

            }

            if (EMIT_SEMANTIC_TAGS)
            {
                // семантические свойства слова
                if (f.semantic_tags != null)
                {
                    foreach (string sem_tag in f.semantic_tags)
                    {
                        b.AppendFormat("{2}sem[{3},{1}]={0}", sem_tag, offset, FieldDelimiter(), edge_part);
                    }
                }
            }
        }

        return;
    }

    void PullFeatures1(System.Text.StringBuilder b, List<CRFTokenFeatures> token_features, int ifocus, int offset, bool rich_set, bool emit_Aa)
    {
        int iword = ifocus + offset;

        if (iword >= 0 && iword < token_features.Count)
        {
            CRFTokenFeatures f = token_features[iword];


            if (EMIT_TOKENS)
            {
                b.AppendFormat("{2}utoken[{0}]={1}", offset, EncodeWordCRF(f.word), FieldDelimiter());
            }

            if (!string.IsNullOrEmpty(f.crf_normal_form))
            {
                b.AppendFormat("{2}norma[{0}]={1}", offset, f.crf_normal_form, FieldDelimiter());
            }

            if (MAX_SUFFIX_LEN > 0)
                b.AppendFormat("{2}sfx[{0}]={1}", offset, f.suffix_id, FieldDelimiter());

            if (emit_Aa && f.Aa && !f.IsBegin && !f.IsEnd)
                b.AppendFormat("{2}Aa[{0}]={1}", offset, f.Aa, FieldDelimiter());

            foreach (string shingle in f.charshingles)
            {
                b.AppendFormat("{0}charshingle[{1}]={2}", FieldDelimiter(), offset, MatchCharShingle(shingle));
            }

            // здесь можно вывести и другие свойства слова.
            if (rich_set && EMIT_POS_TAGS)
            {
                if (LANGUAGE == "ru")
                {
                    b.AppendFormat("{2}pos[{1},N]={0}", f.POS_N, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},A]={0}", f.POS_A, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},V]={0}", f.POS_V, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},IMV]={0}", f.POS_IMV, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},I]={0}", f.POS_I, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},Y]={0}", f.POS_Y, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},VY]={0}", f.POS_VY, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PRN]={0}", f.POS_PRN, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PRN2]={0}", f.POS_PRN2, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},C]={0}", f.POS_C, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},D]={0}", f.POS_D, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},P]={0}", f.POS_P, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PX]={0}", f.POS_PX, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PP]={0}", f.POS_PP, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},MU]={0}", f.POS_MU, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCA]={0}", f.POS_PCA, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCN]={0}", f.POS_PCN, offset, FieldDelimiter());
                }
                else if (LANGUAGE == "en")
                {
                    b.AppendFormat("{2}pos[{1},N]={0}", f.POS_N, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},A]={0}", f.POS_A, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},V]={0}", f.POS_V, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},Y]={0}", f.POS_Y, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PRN]={0}", f.POS_PRN, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},C]={0}", f.POS_C, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},D]={0}", f.POS_D, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},P]={0}", f.POS_P, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PX]={0}", f.POS_PX, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PP]={0}", f.POS_PP, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCA]={0}", f.POS_PCA, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCN]={0}", f.POS_PCN, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCV]={0}", f.POS_PCV, offset, FieldDelimiter());
                    b.AppendFormat("{2}pos[{1},PCM]={0}", f.POS_PCM, offset, FieldDelimiter());
                }
            }

            if (f.morph_tags != null && rich_set && EMIT_MORPH_TAGS)
            {
                foreach (string tag in f.morph_tags)
                {
                    b.AppendFormat("{2}morph[{1}]={0}", tag, offset, FieldDelimiter());
                }
            }

            if (EMIT_SEMANTIC_TAGS)
            {
                if (f.semantic_tags != null)
                {
                    foreach (string sem in f.semantic_tags)
                    {
                        b.AppendFormat("{2}sem[{0}]={1}", offset, sem, FieldDelimiter());
                    }
                }

                if (!EMIT_POS_TAGS && MAX_SUFFIX_LEN == 0 && (f.semantic_tags == null || f.semantic_tags.Count == 0))
                {
                    if (token_features[iword].IsBegin)
                        b.AppendFormat(" IsBegin[{0}]=true", offset);
                    else if (token_features[iword].IsEnd)
                        b.AppendFormat(" IsEnd[{0}]=true", offset);
                    else
                        b.AppendFormat(" IsUnknown[{0}]=true", offset);
                }
            }

            if (EMIT_FORMTAGS_FOR_CONTEXT && offset != 0)
            {
                for (int k = 0; k < f.allform_tags.Count; ++k)
                {
                    b.AppendFormat("{0}formtag[{1}]={2}", FieldDelimiter(), offset, f.allform_tags[k]);
                }
            }

        }

        return;
    }

    void PullFeatures2(System.Text.StringBuilder b, List<CRFTokenFeatures> token_features, int ifocus, int offset1, int offset2)
    {
        int iword1 = ifocus + offset1;
        int iword2 = ifocus + offset2;

        if (iword1 >= 0 && iword1 < token_features.Count && iword2 >= 0 && iword2 < token_features.Count)
