                b.AppendFormat("{4}sfx[{0},{1}]={2},{3}", offset1, offset2, token_features[iword1].suffix_id, token_features[iword2].suffix_id, FieldDelimiter());
            }

            // здесь можно вывести и другие свойства слов.
