    bool IsAa(string s)
    {
        if (s.Length < 2)
            return false;

        if (!char.IsUpper(s[0]))
            return false;

        for (int i = 1; i < s.Length; ++i)
            if (char.IsUpper(s[i]))
                return false;

        return true;
    }


    List<string> test_samples = new List<string>();
    List<string[]> test_sample_tokens = new List<string[]>();

    public void ProcessValidationSample(SentenceData sample)
    {
        if (test_samples_file == null)
        {
            test_samples_file = new System.IO.StreamWriter(System.IO.Path.Combine(tmp_folder, "test_samples.txt"));
        }

        test_samples_file.WriteLine("{0}", sample.GetSentenceStr());

        if (crf_file_test == null)
        {
            crf_file_test = new System.IO.StreamWriter(System.IO.Path.Combine(tmp_folder, "crf_test.txt"));
        }

        bool b = Sentence2Features(crf_file_test, sample);

        if (b)
        {
            test_samples.Add(sample.GetSentenceStr());

            string[] tokens = new string[sample.CountWords()];
            for (int k = 0; k < sample.CountWords(); ++k)
            {
                tokens[k] = sample.GetWord(k).GetWord();
            }

            test_sample_tokens.Add(tokens);
        }

        return;
    }


